async function networkFirst(t){try{var e=await fetch(t);return e.ok&&(await caches.open("MyCache_1")).put(t,e.clone()),e}catch(e){return await caches.match(t)||Response.error()}}self.addEventListener("fetch",e=>{new URL(e.request.url).pathname.match(/^\/inbox/)&&e.respondWith(networkFirst(e.request))});